import React, {Component} from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet';
import L from 'leaflet';


delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
    iconRetinaUrl: require('leaflet/dist/images/pin2.png'),
    iconUrl: require('leaflet/dist/images/pin2.png'),
    shadowUrl: require('leaflet/dist/images/marker-shadow.png')
});
const position = [17.440081, 78.348915];
class MapRender extends Component {

  handleClick = (e) => {
    this.props.setMarker({
      latitude: e.latlng.lat,
      longitude: e.latlng.lng 
    });
  };


  render() {
    return (
      <Map
        ref={this.mapRef}

        zoom={13} 
        style={{ height: '600px', width: '1800px' }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"

        />
        {
          this.props.data.map((data) => (
            <Marker position={[parseFloat(data.latitude), parseFloat(data.longitude)]}>
              <Popup>latitude:{data.latitude}<br />longitude:{data.longitude} <br/> longitude:{data.attr_Name}</Popup>
            </Marker>
          ))
        }
      </Map>
    );
  }
}

export default MapRender;
